text = "data:image/png;base64,"

import base64
from PIL import Image
from io import BytesIO
import cv2
import numpy as np

head,context= text.split(",")
image = base64.b64decode(context)    # 解码时只要内容部分

image = Image.open(BytesIO(image))
image.show()
